import { Link } from "react-router-dom";

export default function Usuario() {
  return (
    <div>
      <h1>Usuário</h1>
      <form>

        <label>
          Nome:
          <input type="text" name="name"/>
        </label>
        <input type="submit" value="Enviar formulário!"/>
      </form>

    <h1></h1>
      <Link to="/">retornar a página inicial</Link>
    </div>
  );
}

